import axios from '@/axios/http';

export function getlistData() {
    // return axios.get('/test')
    return axios({
        url: '/list',
        method: 'get'
    })
}


export function getOneData() {
    // return axios.get('/test')
    return axios({
        url: '/list',
        method: 'get'
    })
}
